import React, { Component } from 'react';
import "./Products.css";
import Container from "react-bootstrap/Container"

class Products extends Component{
    constructor(props){
        super(props);
        this.state = {}
    }
    render(){
        return(
            <Container>

                <div className='filter'></div>
                <div className='row products justify-content-between'>
                <div className='col-lg-2 col-xl-3 tiles'></div>
                <div className='col-lg-2 col-xl-3 tiles'></div>
                <div className='col-lg-2 col-xl-3 tiles'></div>
            </div>
            </Container>
        )
    }
}

export default Products;
